import React, {useState} from "react";
import {Routes, Route, useLocation} from "react-router-dom";

export const TestRoute = (props) => {
  const location = useLocation();
  const propsData = location.state;

  return (
    <div>
      <p> ID {propsData.id}</p>
      <p> Name {propsData.name}</p>
    </div>
  );
};
